    private final Handler mHandler = new Handler(Looper.getMainLooper()){

        @Override
        public void handleMessage(Message msg) {

            switch(msg.what){
                case ShimmerBluetooth.MSG_IDENTIFIER_DATA_PACKET:

                    if (msg.obj instanceof ObjectCluster){
                        ObjectCluster objectCluster = (ObjectCluster) msg.obj;

                        // Retrieve timestamp
                        Collection<FormatCluster> allFormats = objectCluster.getCollectionOfFormatClusters(Configuration.Shimmer3.ObjectClusterSensorName.SYSTEM_TIMESTAMP);
                        FormatCluster timeStampCluster = ((FormatCluster)ObjectCluster.returnFormatCluster(allFormats, "CAL"));
                        double timestamp = timeStampCluster.mData;

                        // Retrieve GSR
                        allFormats = objectCluster.getCollectionOfFormatClusters(Configuration.Shimmer3.ObjectClusterSensorName.GSR_CONDUCTANCE);
                        FormatCluster GSRCluster = ObjectCluster.returnFormatCluster(allFormats, "CAL");
                        final double GSR = GSRCluster.mData;

                        MeasurementValue measurementValue = new MeasurementValue();

                        measurementValue.setGSR(GSR);
                        //measurementValue.setGSR(signal[index]);

                        measurementValue.setTimestamp(timestamp);

                        measurement.getMeasurementValues().add(measurementValue);


                        Log.e("GSR", String.valueOf(index));
                        com.example.android_mobile_app.dto.MeasurementDTO measurementDTO = new com.example.android_mobile_app.dto.MeasurementDTO();

                        //Tell websocket what SR to use
                        measurementDTO.setWearable("Shimmer");
                        measurementDTO.setID(measurementID);

                        measurementDTO.setValue(GSR);
                        //measurementDTO.setValue(signal[index]);

                        Gson gson = new Gson();

                        String json = gson.toJson(measurementDTO);

                        webSocketClient.send(json);
                        //add
//                        testList.add(index,GSR);
//                        List<Integer> resultsMap = signalDetector.analyzeDataForSignals(testList, lag, threshold, influence);

                        runOnUiThread(new Runnable()
                        {
                            @Override
                            public void run()
                            {
                                signalGraphSeries.appendData(new DataPoint(index, GSR), true, 200);
                                //signalGraphSeries.appendData(new DataPoint(index, signal[index]), true, 200);
                            }
                        });

                        index++;
                    }
                    break;

                case ShimmerBluetooth.MSG_IDENTIFIER_SHIMMER_DOCKED_STATE_CHANGE:
                    ShimmerBluetooth.BT_STATE state = null;
                    String MacAddress = "";

                    if (msg.obj instanceof ObjectCluster) {
                        state = ((ObjectCluster) msg.obj).mState;
                        MacAddress = ((ObjectCluster) msg.obj).getMacAddress();
                    } else if (msg.obj instanceof CallbackObject) {
                        state = ((CallbackObject) msg.obj).mState;
                        MacAddress = ((CallbackObject) msg.obj).mBluetoothAddress;
                    }

                    switch (state) {
                        case CONNECTED:
                            Log.e("Status", "connected");
                            break;
                        case CONNECTING:
                            Log.e("Status", "Connecting");
                            break;
                        case STREAMING:
                            Log.e("Status", "Streaming");
                            break;
                        case STREAMING_AND_SDLOGGING:
                            Log.e("Status", "STREAMING_AND_SDLOGGING");
                            break;
                        case SDLOGGING:
                            Log.e("Status", "SDLOGGING");
                            break;
                        case DISCONNECTED:
                            Log.e("Status", "DISCONNECTED");
                            break;
                    }
                    break;
            }

            super.handleMessage(msg);
            //Tap Listener
            signalGraphSeries.setOnDataPointTapListener(new OnDataPointTapListener() {
                @Override
                public void onTap(Series series, DataPointInterface dataPoint) {
                    Toast.makeText(getApplicationContext(),"Reaction has been made on Data Point:" + dataPoint, Toast.LENGTH_SHORT).show();
                    //Added DataPoint to New Line Graph
                    MarkGraphSeries.appendData(new DataPoint(dataPoint.getX(),dataPoint.getY()),true,200);
                    //Write Emotion Data to Measurement Value
                    //measurement.getMeasurementValues().get(index - 1).setEmotion("Happy");
                    measurement.getMeasurementValues().get(index - 1).setEmotion(emotion);
                }
            });
        }
    };


    @Override
    protected void onStop() {
        //Disconnect the Shimmer device when this activity is stopped
        if(shimmer != null) {
            if(shimmer.isSDLogging()) {
                shimmer.stopSDLogging();
                Log.d(TAG, "Stopped Shimmer Logging");
            }
            else if(shimmer.isStreaming()) {
                shimmer.stopStreaming();
                Log.d(TAG, "Stopped Shimmer Streaming");
            }
            else {
                shimmer.stopStreamingAndLogging();
                Log.d(TAG, "Stopped Shimmer Streaming and Logging");
            }
        }
        if (shimmer.getState()== ShimmerBluetooth.BT_STATE.CONNECTED){
            shimmer.disconnect();
        }
        Log.i(TAG, "Shimmer DISCONNECTED");
        super.onStop();
    }

    public void startStreaming(View view) {

        Log.e("Shimmer", "Streaming started");
        shimmer.getState();

        shimmer.setSamplingRateShimmer(6.0);

        shimmer.startStreaming();

        measurement.setTimestampStart(new Timestamp(System.currentTimeMillis()));

        startTimer();
        measureStart = true;

        startMeasurementButton.setEnabled(false);
        startMeasurementButton.setVisibility(View.GONE);
        stopMeasurementButton.setEnabled(true);
        stopMeasurementButton.setVisibility(View.VISIBLE);
    }



    public void stopStreaming(View view) {
        if (shimmer.isStreaming()){
            shimmer.stopStreaming();
            shimmer.stop();
            shimmer.disconnect();
        }

        for(SCR s: finalSCRvalues){
            measurement.getMeasurementValues().get(s.getIndex()-1).setFinalSCR(s.getValue());
        }
        measurement.setTimestampEnd(new Timestamp(System.currentTimeMillis()));

        Intent intent = new Intent(getApplicationContext(), MeasurementCompleted.class);
        intent.putExtra("measurement", measurement);

        startActivity(intent);

        finish();
    }

    public double getAverageSCL(List<Double> SCLs){
        double res = 0;
        try{
            sclAmount=SCLs.size();
            int averageTime = 60;
            double sum =0;
            if(sclAmount!=0){
                if(sclAmount<=averageTime){
                    for(Double scl: SCLs){
                        sum+=scl;
                    }
                    res=sum/sclAmount;
                }else {
                    for(int i = 0; i<averageTime; i ++){
                        sum += SCLs.get(sclAmount-i-1);
                    }
                    res=sum/averageTime;
                }
            }
        } catch (Exception e) {
            Log.e("SCLAverageBug:",e.toString(),e);
        }
        return res;
    }

    public void startTimer(){
        countDownTimer = new CountDownTimer(timeLeftInMilliseconds,1000) {
            @Override
            public void onTick(long millisUntilFinished) {
                timeLeftInMilliseconds = millisUntilFinished;
                updateTimer();
            }

            @Override
            public void onFinish() {

            }
        }.start();
    }

    public void updateTimer(){
        int minutes = (int)timeLeftInMilliseconds / 60000;
        int seconds = (int)timeLeftInMilliseconds % 60000 / 1000;

        String timeLeftText;
        timeLeftText = "" + minutes;
        timeLeftText += ":";
        if(seconds<10) timeLeftText += "0";
        timeLeftText += seconds;

        countdownText.setText(timeLeftText);
    }

